import React from 'react';

const Sidebar = ({ isOpen, toggleSidebar }) => {
  return (
    <nav className={`sidebar ${isOpen ? 'open' : ''}`}>
      <button className="sidebar-close" onClick={toggleSidebar}>
        &times;
      </button>
      <ul>
        <li>Dashboard</li>
        <li>Inventory</li>
        <li>Donors</li>
        <li>Requests</li>
        <li>Reports</li>
        {/* Add more sidebar items as needed */}
      </ul>
    </nav>
  );
};

export default Sidebar;
